var canvTempBandeau=document.createElement('canvas');
canvTempBandeau.width=180;
canvTempBandeau.height=90;
var ctxTempBandeau = canvTempBandeau.getContext("2d");

var imageBandeauTomoS36 = new Image();
imageBandeauTomoS36.src = 'data:image/false;base64,';
imageBandeauTomoS36.onload =function(){verifieImageTomo();}

var imageDataAnom=new Array();

function verifieImageTomo () {
	if (IsImageOk(imageBandeauTomoS36)) {avanceCharge();}
	else {setTimeout(verifieImageTomo,10);}
}

function preCalcTomoS362() {
	var id;
	for (var i=0;i<25;i++) { //tranches
		imageDataAnom[i]=new Uint8Array(16200); // 180*90
		ctxTempBandeau.drawImage (imageBandeauTomoS36,0,90*i,180,90,0,0,180,90);
		id=ctxTempBandeau.getImageData(0,0,180,90).data; 
		for (var j=0;j<16200;j++) {
			imageDataAnom[i][j]=id [j<<2]; //division par 4
		}
	}
	id.width=0;
	id.height=0;
}

function effaceImageTomoS362() {
	canvTempBandeau.width=0;
	canvTempBandeau.height=0;
	imageBandeauTomoS36.width=0;
	imageBandeauTomoS36.height=0;
}
	
function getAnomFromBandeau (lati,longi,tranche) {
	if (tranche<1) {return 0;}
	if (tranche>26) {tranche=26;}
	if (longi>180) {longi-=360;}
	var x=Math.round((longi+180)/2);
	var y=Math.round((lati+90)/2);
	var n=(x+y*180); 
	var c=imageDataAnom[tranche-1][n];
	//console.log ("x="+x+" y="+y+" c="+c);
	var v=(c-128)/12;
	return v;
}


function IsImageOk(img) {
    if (!img.complete) {
        return false;
    }

    if (typeof img.naturalWidth !== "undefined" && img.naturalWidth === 0) {
        return false;
    }

    return true;
}